import request from '@/utils/request';
/**
 * 游戏结果
 *
 * @param {
 * startTime (string, optional): 开始日期
 * endTime (string, optional): 结束日期 ,
 * gameType (string, optional): 游戏类型 ,
 * pageIndex (integer, optional): ,
 * pageSize (integer)
 * roundNo (integer, optional): 局号
 * tableName (string)
 * } params
 */

export function gameResultSearch(params) {
  return request({
    url: '/gameResult/search',
    method: 'get',
    params: params
  });
}
export function getBetCardList(params) {
  return request({
    url: '/gameResult/getBetCardList',
    method: 'get',
    params: params
  });
}
export function checkCard(params) {
  return request({
    url: '/gameResult/checkCard',
    method: 'get',
    params: params
  });
}
export function checkUrllist(params) {
  return request({
    url: '/gameResult/checkUrllist',
    method: 'get',
    params: params
  });
} // 查询游戏厅

export function queryGamingRoom(params) {
  return request({
    url: '/player/queryGamingRoom',
    method: 'get',
    params: params
  });
} // 重算前牌型

export function recalculateBureau(params) {
  return request({
    url: '/gameResult/recalculateBureau',
    method: 'get',
    params: params
  });
}
export default {
  gameResultSearch: gameResultSearch,
  checkCard: checkCard,
  checkUrllist: checkUrllist,
  queryGamingRoom: queryGamingRoom,
  recalculateBureau: recalculateBureau
};
